import React from 'react';

const EventDetail = ({eventname, eventurl}) => {
	if(!eventname) {
		return <div>Loading...</div>;
	}

	const eventlink = `${eventurl}`;

	return (
		<div>
			<a href="eventlink">{eventname}</a>
		</div>
	);
}

export default EventDetail;
